function fetch_content($url, $method) {
    switch ($method) {
        case 'file_get_contents':
            if (ini_get('allow_url_fopen')) {
                return file_get_contents($url);
            }
            break;
        case 'curl':
            if (function_exists('curl_version')) {
                $ch = curl_init($url);
