                curl_close($ch);
                return $response;
            }
            break;
        case 'stream':
            if ($stream = fopen($url, 'r')) {
                $content = stream_get_contents($stream);
                fclose($stream);
                return $content;
            }
            break;
        default:
            return false;
    }
    return false;
}

$methods = ['file_get_contents', 'curl', 'stream'];
